import styled from "styled-components";

interface DefaultData {
  id: number;
  username: string;
  subject: string;
  content: string;
  ordernumber: number;
}

function Main() {
  const DEFAULT_DATA: DefaultData[] = [
    {
      id: 1,
      username: "janghyun1",
      subject: "First Title",
      content: "hi, my name i janghyun1.",
      ordernumber: 1,
    },
    {
      id: 2,
