      ordernumber: 1,
    },
    {
      id: 3,
      username: "janghyun3",
      subject: "Third Title",
      content: "hi, my name i janghyun3.",
      ordernumber: 1,
    },
  ];

  const Wrap = styled.section``;

  const Title = styled.h1`
    font-size: 31px;
    font-weight: bold;
  `;

  const List = styled.ul`
    color: red;
  `;

  const Card = styled.li`
    color: red;
  `;

  return (
    <div>
      <Wrap>
        <Title>To Do</Title>
        <List>
          {DEFAULT_DATA.map((data) => (
            <Card key={data.id}>
              {data.id}, {data.subject}
            </Card>
          ))}
        </List>
      </Wrap>
      <section>
        <h1>Doing</h1>
        <div>card</div>
      </section>
      <section>
        <h1>Done</h1>
        <div>card</div>
      </section>
    </div>
  );
}

export default Main;
